    data: |
      SELECT + 30 + + + col2 + + + col1 + ( + - col1 ) * - col2 * + col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE + ( + + 66 ) - col1 NOT BETWEEN - - 35 AND - + col0;
  - name: tab2

outputs:
  - name: q3547.out
    data: |
      123347
      225543
      27083
